  p_nlp.np = 192;
  p_nlp.detect_bounds.ng = 0;
  casadi_nlpsol_init(&d_nlp, &arg, &res, &iw, &w);
  if (d_nlp.x0) {
    casadi_copy(d_nlp.x0, 246, d_nlp.z);
  } else {
    casadi_clear(d_nlp.z, 246);
  }
  if (d_nlp.lbx) {
    casadi_copy(d_nlp.lbx, 246, d_nlp.lbz);
  } else {
    casadi_fill(d_nlp.lbz, 246, -casadi_inf);
  }
  if (d_nlp.ubx) {
    casadi_copy(d_nlp.ubx, 246, d_nlp.ubz);
  } else {
    casadi_fill(d_nlp.ubz, 246, casadi_inf);
  }
  if (d_nlp.lam_x0) {
    casadi_copy(d_nlp.lam_x0, 246, d_nlp.lam);
  } else {
    casadi_clear(d_nlp.lam, 246);
  }
  if (d_nlp.lbg) {
    casadi_copy(d_nlp.lbg, 216, d_nlp.lbz+246);
  } else {
    casadi_fill(d_nlp.lbz+246, 216, -casadi_inf);
  }
  if (d_nlp.ubg) {
    casadi_copy(d_nlp.ubg, 216, d_nlp.ubz+246);
  } else {
    casadi_fill(d_nlp.ubz+246, 216, casadi_inf);
  }
  if (d_nlp.lam_g0) {
    casadi_copy(d_nlp.lam_g0, 216, d_nlp.lam+246);
  } else {
    casadi_clear(d_nlp.lam+246, 216);
  }
  d->nlp = &d_nlp;
  d->prob = &p;
  p.nlp = &p_nlp;
  p.sp_a = casadi_s0;
  p.sp_h = casadi_s1;
  casadi_ipopt_setup(&p);
  p.eval_f = casadi_nlp_f0;
  p.eval_g = casadi_nlp_g0;
  p.eval_grad_f = casadi_nlp_grad_f0;
  p.eval_jac_g = casadi_nlp_jac_g0;
  p.eval_h = casadi_nlp_hess_l0;
