  d->res[0] = 0;
  d->res[1] = 0;
  d->res[2] = 0;
  d->res[3] = d_nlp.lam_p;
  if (casadi_f1(d->arg, d->res, d->iw, d->w, 0)) return 1;
  casadi_scal(192, -1.0, d_nlp.lam_p);
